import React, { useState, useEffect } from 'react';
import Form from 'react-bootstrap/Form';


const AddMovie = (props) => {
  const [movie, setMovie] = useState();
  const years = [];
  const diff = 2021 - 1960;
  let startYear = 1960;
  useEffect(() => {
    for (let i = 0; i < diff; i++) {
      years[i] = startYear;
      startYear++;
    }
    console.log(years);
  }, [])

  return (
    <Form>



      <Form.Group controlId="movietitle">
        <Form.Label>What is the title of the movie?</Form.Label>
        <Form.Control type="email" placeholder="Bad Boys" />
      </Form.Group>

      <Form.Group controlId="year">
        <Form.Label>What year was it/will it get published</Form.Label>
        <Form.Control as="select">

          {
            years.map((year, i) => (
              <option key={i} value={year}>{year}</option>
            ))
          }

        </Form.Control>
      </Form.Group>

      <Form.Group controlId="directors">
        <Form.Label>Choose the directors</Form.Label>
        <Form.Control as="select" multiple>
          <option>1</option>
          <option>2</option>
          <option>3</option>
          <option>4</option>
          <option>5</option>
        </Form.Control>
      </Form.Group>



    </Form>

  );
}

export default AddMovie;
